import React from "react";
import "./Footer.css";

export default function Footer() {
	return (
		<footer>
			<a
				href="https://github.com/daniel-ulises/rockpaperscissors"
				target="_blank"
				rel="noopener noreferrer"
			>
				<i class="fab fa-github"></i>
			</a>
		</footer>
	);
}
